import { useNavigate } from "react-router-dom"
import "./CstoreMain.css";

const CStore = ()=>{

  const navigate = useNavigate();
   const teens=()=>{
    navigate("/teens")
   }
   const comic=()=>{
    navigate("/comic")
   }
   const kids=()=>{
    navigate("/kids")
   }
   const kodesh=()=>{
    navigate("/kodesh")
   }
    return(
       <><div className="container">
       <div className="image-wrapper1">
       <img src="w.jpg" style={{ height: "180px", width: "180px", fontFamily: "initial" }}></img>
       </div>
       <button className="button" onClick={(e)=>teens()}>Teens</button>
       <button onClick={(e)=>comic()}>Comic</button>
       <button onClick={(e)=>kids()}>Kids</button>
       <button onClick={(e)=>kodesh()}>Kodesh</button>
       </div>
       </>
     
    );

}
export default CStore;
